import React from "react";

const RecipeItem = ({ meal }) => {
  return (
    <div className="RecipeItem">
      <img src={meal.image} alt={meal.name} />
      <h2>{meal.strMeal}</h2>
    </div>
  );
}

export default RecipeItem;
